import React from "react";

export default function ScrollBar() {
  return (
    <div
      style={{
        overflowY: "scroll",
        scrollbarColor: "blue",
        scrollbarWidth: "thin",
        scrollbarTrackColor: "transparent",
      }}
    >
      {/* This div is empty, so only the scrollbar will be visible */}
    </div>
  );
}
